var canvas    = document.getElementById("scene");
var ctx       = canvas.getContext("2d");
var particles = [];

function drawScene(){
    //aggiunge un padding ai bordi dell'immagine
    canvas.width = png.width+150;
    canvas.height = png.height+70;
    
    canvas.addEventListener('mousemove', move, false);

    ctx.drawImage(png, 0, 0);

    var data = ctx.getImageData(0, 0, png.width, png.height);
    ctx.clearRect(0,0,canvas.width, canvas.height);

    //itera i pixel dell'immagine per popolare l'array di particelle da mostrare a schermo
    for (var y = 0, y2 = data.height; y < y2; y=y+4) {
        for (var x = 0, x2 = data.width; x < x2; x=x+4) {
            if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 128) {
                var particle = {
                    x : x+75,
                    y : y+35,
                    y0: y+35,
                    x0: x+75,
                    xDelta: 0,
                    yDelta: 0
                };
                particles.push(particle);
            }
        }
    }

    console.log(particles);
    ctx.fillStyle = "White";

    //renderizza sul canvas l'array di particelle ogni secondo
    var renderStuff = setInterval(function() {
        ctx.clearRect(0,0,canvas.width, canvas.height);
        for(var i=0, j=particles.length; i<j; i++){
            var particle = particles[i];
            ctx.save();
            
            if(Math.sqrt(Math.pow(particle.x-particle.x0,2)+Math.pow(particle.y-particle.y0, 2)) > 1){
                particle.x += particle.xDelta/150;
                particle.y += particle.yDelta/150;
            }
            else{ //se la distanza dalla posizione originale non supera la soglia, la risetta
                particle.x = particle.x0;
                particle.y =  particle.y0;
            }
            ctx.fillRect(particle.x, particle.y, 2, 2);
        }
    }, 1);

}

function move(e){
    var rect = e.target.getBoundingClientRect();
    mouseX = e.clientX - rect.left; //coordinata x all'interno dell'elemento canvas
    mouseY = e.clientY - rect.top;  //coordinata y all'interno dell'elemento canvas

    for(var i=0, j=particles.length; i<j; i++){
        var xDistance = particles[i].x - mouseX; //distanza particella dal mouse lungo x
        var yDistance = particles[i].y - mouseY; //distanza particella dal mouse lungo y
        var distance = Math.sqrt(xDistance * xDistance + yDistance * yDistance); //distanza euclidea

        if (distance < 20) { //solo le particelle entro questa distanza dal mouse sono spostate
            angle = Math.atan2(yDistance,xDistance);
            particles[i].x += Math.cos(angle) * distance;
            particles[i].y += Math.sin(angle) * distance;

            particles[i].yDelta = particles[i].y0 - particles[i].y;
            particles[i].xDelta = particles[i].x0 - particles[i].x;
        }
    }
}

//creazione oggetto immagine codificata in base 64
var png = new Image();
png.onload = drawScene;
png.src = "data:image/png;base64,";